snippet.textDisplay:
@Kiko Calzado González Que vaya por delante que yo no estoy de acuerdo con las concentraciones en plena pandemia.
¿Porque son malas solo las manifestaciones de los que llevan bandera de España? ¿que pasa con el funeral de Anguita y sus cientos de asistentes pegados unos a otros sin mascarillas?  ¿que pasa con las concentraciones a favor de los presos de ETA que el propio Ministerio de Sanidad no recomendó pero el Gobierno autorizó?
Si se critica una se tienen que criticar todas, ¿o es que el corona solo afecta a los "ricos" y a los autónomos y hay que protegerlos?

